import Navbar from 'react-bootstrap/Navbar'

function Header (){
    return (
        <div>
            <Navbar bg="light">
            <Navbar.Brand href="#home">Brand link</Navbar.Brand>
            </Navbar>
        </div>

    );
}

export default Header;
